local MapSpriteTable = xyd.tables.mapSprite
local LengthX = 256
local LengthY = 1024

function xyd.getKingdomSprite(ix, iy)
	local x, y

	if iy % 2 == 1 then
		x = (ix - 1) / 2
	else
		x = ix / 2
	end

	y = iy

	local x2 = Mathf.Repeat(x, LengthX)
	local y2 = Mathf.Repeat(y, LengthY)

	x2 = x2 + 1
	y2 = y2 + 1

	local row = xyd.kingdomconfig[y2]
	local id = row[x2]

	return id
end
